<!DOCTYPE html>
<html xmlns="http://www.w3.org/1999/xhtml" lang="en">
  <head>
    <title>403</title>
    <meta http-equiv="X-UA-Compatible" content="IE=edge" />
    <meta http-equiv="content-type" content="text/html; charset=utf-8" />
    <meta
      name="viewport"
      content="width=width=device-width, user-scalable=no, initial-scale=1.0, maximum-scale=1.0, minimum-scale=1.0"
    />
    <script>
      function getQueryString(name) {
        var reg = new RegExp('(^|&)' + name + '=([^&]*)(&|$)')
        var r = window.location.search.substr(1).match(reg)
        if (r != null) return unescape(r[2])
        return null
      }
      try {
        const logId = getQueryString('logId')
        const log = sessionStorage.getItem(logId)
        sessionStorage.removeItem(logId)
        console.log(log)
        //改变地址栏参数到根路径，下次刷新可重新进行ip检测逻辑
        window.history.pushState('', '', window.location.origin)
        window.addEventListener('load', () => {
          const $IpInfoDom = document.querySelector('.c-ip-container')
          const data = JSON.parse(log).data.data
          $IpInfoDom.innerHTML = `<span>IP:${data.ip} (${data.country}-${data.city}-${data.regionName}) </span>`
        })
      } catch (error) {}
    </script>
  </head>
  <style>
    ::-webkit-scrollbar {
      width: 5px;
      height: 5px;
    }

    ::-webkit-scrollbar-track-piece {
      background-color: transparent;
      border-radius: 6px;
    }

    ::-webkit-scrollbar-thumb:vertical {
      height: 5px;
      background-color: #bfbfbf;
      border-radius: 6px;
    }

    ::-webkit-scrollbar-thumb:horizontal {
      width: 5px;
      background-color: #bfbfbf;
      border-radius: 6px;
    }
    @media (min-width: 751px) {
      html {
        font-size: calc(1920px / (1920 / 100));
      }
    }
    /**mobile**/
    @media (max-width: 750px) {
      html {
        font-size: calc(100vw / (750 / 100));
      }
      .app {
        width: 100%;
        justify-content: center;
      }
    }
    * {
      margin: 0;
      padding: 0;
      box-sizing: border-box;
    }

    .app {
      width: 9rem;
      padding: 0 0.2rem;
      max-width: 100%;
      position: absolute;
      left: 0;
      top: 0;
      right: 0;
      bottom: 0;
      margin: auto;
      display: flex;
      flex-direction: column;
    }
    .app .c-img {
      text-align: center;

    .app .c-img img {
      width: 3rem;
      max-width: 100%;
    }
    .app .c-txt .c-txt-1 {
      font-weight: bold;
      color: #333;
      text-align: center;
      line-height: 0.5rem;
      font-size: 0.41rem;
    }
    .app .c-txt .c-txt-2 {
      margin-top: 0.1rem;
      color: #666;
      font-size: 0.27rem;
    }
    .app .c-txt .c-center {
      text-align: center;
    }

    .app .c-ip-container {
      position: fixed;
      bottom: 0;
      left: 0;
      width: 100%;
      display: flex;
      align-items: center;
      justify-content: center;
      font-size: 0.18rem;
      height: 0.4rem;
      border-top: 1px solid #c9c9c9;
      color: #c9c9c9;
    }
  </style>
